import React from 'react';
import logo from './NusLogo.jpg';
import './App.css';


//after return: this looks like html but it isnt. it is JSX. DIV is a section; same as in html
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo is missing" />
        <p>
          Welcome to my House wahahaha

        </p>
        <a
          className="App-link"
          href="http://www.google.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          Go to Google
        </a>
      </header>
    </div>
  );
}

export default App;
